import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import mitt from 'mitt'

const emitter = mitt();

const app = createApp(App).use(router);
app.config.globalProperties.emitter = emitter;
app.mixin
app.mount('#app');
